static bool __shift_jis_lead_byte(int b)
{
	if (is_between_int(b, 0x81, 0x9F))
		return(true);
	if (is_between_int(b, 0xe0, 0xfc))
		return(true);
	return(false);
}

/*** Translate a string in Windows 932 codepage (ANSI Japanese, similar to Shift JIS with support for NEC extended characters)
	to a Unicode UTF-32 string. Returns the allocated result. ***/
ustring w932toustr(const char* str)
{
	int l = strlen(str);
	ustring ustr = NEW_USTR(l);
	uch* w;
	NOT_NULL_OR_RETURN(ustr, NULL);
	w = ustr;
	while (*str)
		{
		if (__shift_jis_lead_byte(*(unsigned char*)str))
			{
			int code = (*(unsigned char*)str) << 8;
			++str;
			if (!(*str))
				break;
			code += *(unsigned char*)str;
			if (code < 0xE000)
				*w = (uch)__win932_8100[code - 0x8100];
			else
				*w = (uch)__win932_E000[code - 0xE000];
			}
		else
			{
			*w = __win932[*(unsigned char*)str];
			}
		++w;
		++str;
		}
	*w = 0;
	return(ustr);
}

static bool __dbcs_lead_byte(int b)
{
	return (is_between_int(b, 0x81, 0xFE));
}

